import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a product card to open the detail modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child');

    // Wait for the modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Take screenshot of the opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract product information from the modal
    const productTitle = await page.textContent('.product-detail-title');
    const productPrice = await page.textContent('.product-detail-price');

    return {
      success: true,
      action: "Opened product detail modal by clicking on first product card",
      extractedData: {
        productTitle: productTitle?.trim(),
        productPrice: productPrice?.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
